const SkeletonLoaderComponent = class {
  constructor(hostRef) {
    registerInstance(this, hostRef);
    /** Number of loader lines that will be rendered */
    this.repetitions = 1;
    /** Height of loader line */
    this.height = 38;
  }
  render() {
    return Array(this.repetitions)
      .fill(0)
      .map(() => h("div", { class: "skeleton-loader", style: { height: `${this.height}px` } }));
  }
};
SkeletonLoaderComponent.style = skLoaderCss;

const titleCss = "";

const TitleComponent = class {
  constructor(hostRef) {
    registerInstance(this, hostRef);
  }
  render() {
    return h("h2", null, this.titleText);
  }
};
TitleComponent.style = titleCss;

